import React, { useState, useEffect } from 'react';
import './ReportsLayout.css';

const ReportsLayout = () => {
  const [reports, setReports] = useState([]);

  // Fetch reports data from an API or static data
  useEffect(() => {
    // Example static data, replace with API call if needed
    const fetchReports = async () => {
      // Replace with your API call
      const fetchedReports = [
        { serial: 'R001', doctorName: 'Dr. James Brown', speciality: 'Cardiologist' },
        { serial: 'R002', doctorName: 'Dr. Jameson Daniels', speciality: 'Neurologist' },
        { serial: 'R003', doctorName: 'Dr. Sam Brown', speciality: 'Pediatrician' },
      ];
      setReports(fetchedReports);
    };

    fetchReports();
  }, []);

  const handleViewReport = (serial) => {
    // Handle view report action
    alert(`Viewing report: ${serial}`);
  };

  const handleDownloadReport = (serial) => {
    // Handle download report action
    alert(`Downloading report: ${serial}`);
  };

  return (
    <div className="reports-layout">
      <h2>Your Reports</h2>
      <table className="reports-table">
        <thead>
          <tr>
            <th>Serial Number</th>
            <th>Doctor Name</th>
            <th>Speciality</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {reports.map((report) => (
            <tr key={report.serial}>
              <td>{report.serial}</td>
              <td>{report.doctorName}</td>
              <td>{report.speciality}</td>
              <td>
                <button onClick={() => handleViewReport(report.serial)}>View Report</button>
                <button onClick={() => handleDownloadReport(report.serial)}>Download Report</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ReportsLayout;
